import axios from "axios";
import React, { useEffect, useState } from "react";
import "./aboutpool.css";
import car1 from "./car12.png"

function AllPool({ allPool }) {
  const loggedinUser = parseInt(localStorage.getItem("logged"));
  const [selectedRow, setSelectedRow] = useState(null);

  const [values, setValues] = useState({
    poolid: 0,
    loginid: loggedinUser,
  });

  const handleClick = (row) => {
    setSelectedRow(row);
  };
  console.log(allPool);
  useEffect(() => {
    if (selectedRow != null) {
      setValues({ poolid: selectedRow.poolId, loginid: loggedinUser });
      console.log(values);
    }
  }, [selectedRow]);

  const handleCheckIn = () => {
    axios
      .post("http://localhost:8081/checkin", values)
      .then((res) => {
        console.log(res);
      })
      .catch((error) => {
        console.log(error.response.data);
        // toast.error(error.response.data.error, {
        //   position: "top-center",
        // });
      });
  };

  return (
    <>
      <div className="allpooldiv">
        {/* <div>These are available pools</div><br /><br /><br /><br /><br /> */}
        <div className="mainpool">
          {allPool.map((item) => (
            <div
              className="poolintro"
              key={item.id}
              onClick={() => handleClick(item)}
            >
              <div className="toppara">
              {item.poolBy}'s Pool
              </div>
              <img src={car1} />
              <div className="outerpara">
                <b>Pool Starting From:</b> {item.poolFrom}
              </div>
              <div className="outerpara">
                <b>Pool Date:</b> {item.poolDate}
              </div>
            </div>
          ))}
        </div>
        <div className="selecteddiv">
          {selectedRow && (
            <div className="modal-background">
              <div className="modal-container">
                <div className="pooldetails">
                  <div className="poolvalues">
                    <b>Pool Created By: </b>
                    {"\t"}
                    {selectedRow.poolBy}
                  </div>
                  <div className="poolvalues">
                    <b>Pool From: </b>
                    {"\t"}
                    {selectedRow.poolFrom}
                  </div>
                  <div className="poolvalues">
                    <b>Pool To: </b>
                    {"\t"}
                    {selectedRow.poolTo}
                  </div>
                  <div className="poolvalues">
                    <b>Pool Date: </b>
                    {"\t"}
                    {selectedRow.poolDate}
                  </div>
                  <div className="poolvalues">
                    <b>Pool Time: </b>
                    {"\t"}
                    {selectedRow.poolTime}
                  </div>
                  <div className="poolvalues">
                    <b>Pool Seats: </b>
                    {"\t"}
                    {selectedRow.poolSeats}
                  </div>
                  <div className="poolvalues">
                    <b>Available Seats: </b>
                    {"\t"}
                    {selectedRow.availableSeats}
                  </div>
                </div>
                <div className="poolbutton">
                  {selectedRow.members.length>0 && selectedRow.members.includes(loggedinUser) === true ? (
                    <button class="btn btn-success">
                      You have already checked in{" "}
                    </button>
                  ) : selectedRow.availableSeats > 0 ? (
                    <button class="btn btn-primary" onClick={handleCheckIn}>Please Check In for Availaing this pool</button>
                  ) : (
                    <button class="btn btn-danger">Sorry! No more Seats Available </button>
                  )}
                  <button class="btn btn-danger" style={{width:"30%"}}
                    onClick={() => setSelectedRow(null)}
                  >
                    Close
                  </button>
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </>
  );
}

export default AllPool;
